<script>
	import { onMount, afterUpdate } from 'svelte';
	import ArrowSvg from '$lib/icons/arrow.svelte';
	import { goto } from '$app/navigation';
	import Search from '$lib/Search.svelte';

	let tables1, tables2, tables3, bookings1, bookings2;

	// import BackSvg from '$lib/icons/back3.svelte';

	let arrowDiv;
	let scaleFactor;

	export let selectedRoomKey;

	function saveRooms() {
		localStorage.setItem('rooms', JSON.stringify(rooms));
	}

	function loadRooms() {
		const storedRooms = localStorage.getItem('rooms');
		if (storedRooms) {
			rooms = JSON.parse(storedRooms);
		}
	}

	let rooms = {
		workspace_1: {
			name: 'Рабочее пространство 1',
			description: 'В этом рабочем пространстве располагаются члены команды разработки A'
		},
		workspace_2: {
			name: 'Рабочее пространство 2',
			description: 'В этом рабочем пространстве располагаются члены команды разработки B'
		},
		workspace_3: {
			name: 'Рабочее пространство 3',
			description: 'В этом рабочем пространстве располагаются члены команды разработки C'
		},
		talking_room_1: {
			name: 'Переговорная 1',
			description: 'В этой переговорной комнате поместится до 18-ти человек'
		},
		talking_room_2: {
			name: 'Переговорная 2',
			description: 'В этой переговорной комнате поместится до 11-ти человек'
		},
		dining_room: {
			name: 'Столовая',
			description: 'Здесь всегда можно найти вкусный кофе и легкий перекус'
		},
		gaming_room: {
			name: 'Игровая комната',
			description: 'Здесь можно поиграться с очками виртуальной реальности и PS4'
		},
		exit: {
			name: 'Выход',
			description: 'Выход, ведущий к главной лестнице'
		},
		toilet: {
			name: 'Туалет',
			description: 'Мужской и женский туалет'
		}
	};

	onMount(() => {
		saveRooms();
		loadRooms();
		tables1 = JSON.parse(localStorage.getItem('tables1')) || {};
		tables2 = JSON.parse(localStorage.getItem('tables2')) || {};
		tables3 = JSON.parse(localStorage.getItem('tables3')) || {};
		bookings1 = JSON.parse(localStorage.getItem('bookings1')) || {};
		bookings2 = JSON.parse(localStorage.getItem('bookings2')) || {};

		const svgContainer = document.getElementById('rooms_svg_container');

		svgContainer.addEventListener('click', (event) => {
			const target = event.target;

			if (target.tagName === 'path' && target.hasAttribute('id')) {
				selectedRoomKey = target.id;
			}
		});

		svgContainer.addEventListener('click', (event) => {
			const target = event.target;

			if (target.tagName !== 'path' || !target.hasAttribute('id')) {
				const arrowDiv = document.getElementById('ArrowSvgDiv');
				arrowDiv.style = 'position: absolute; display: none';
				selectedRoomKey = undefined;
			}
		});

		document.addEventListener('keyup', (event) => {
			if (event.key === 'Escape') {
				const arrowDiv = document.getElementById('ArrowSvgDiv');
				arrowDiv.style = 'position: absolute; display: none';
				selectedRoomKey = undefined;
			}
		});

		const searchInput = document.getElementById('search-input');
		const searchResults = document.getElementById('search-results');

		if (searchInput) {
			searchInput.addEventListener('input', () => {
				if (searchInput === undefined) {
					return;
				}
				// console.log(searchInput)
				const inputValue = searchInput.value.toLowerCase();
				let resultsHtml = '';

				// search rooms by name
				for (const roomKey in rooms) {
					const room = rooms[roomKey];
					if (room.name.toLowerCase().includes(inputValue)) {
						resultsHtml += `<div>${room.name}</div>`;
					}
				}

				// search names in tables
				for (const tableKey in tables1) {
					const table = tables1[tableKey];
					if (table.name.toLowerCase().includes(inputValue)) {
						resultsHtml += `<div>${table.name} is located at ${tableKey}</div>`;
					}
				}

				// search rooms by name in bookings
				for (const bookingKey in bookings1) {
					const booking = bookings1[bookingKey];
					for (const timeSlot in booking) {
						const room = booking[timeSlot];
						if (room.booked && room.description.toLowerCase().includes(inputValue)) {
							resultsHtml += `<div>${room.description} is booked on ${bookingKey} at ${timeSlot}</div>`;
						}
					}
				}

				// display search results
				searchResults.innerHTML = resultsHtml;
			});
		}
	});

	function updateSelectedRoomColor() {
		const room_svg_container = document.getElementById('rooms_svg_container');
		if (room_svg_container && selectedRoomKey) {
			const path = room_svg_container.querySelector(`#${selectedRoomKey}`);
			if (path) {
				// Add the blinking class to the selected path
				path.classList.add('blinking');
			}
		}
	}

	function removeBlinking() {
		const room_svg_container = document.getElementById('rooms_svg_container');
		if (room_svg_container) {
			for (const key in rooms) {
				if (key != selectedRoomKey) {
					const path = room_svg_container.querySelector(`#${key}`);
					path.classList.remove('blinking');
				}
			}
		}
	}

	afterUpdate(() => {
		saveRooms();
		updateSelectedRoomColor();
		removeBlinking();
		// ... (other afterUpdate code)
	});
</script>

